import { Link }  from 'react-router-dom';
import 'animate.css';

let vid = document.getElementById("myVideo");
function playVid() {
  vid.play();
	vid.autoplay = true;
	document.getElementById("myVideo").load();

}

function myFunction() {
  document.getElementById("myVideo").load();
}


export default () => (
	<div className='landing'>
		<div className='info'>
		<div id="myVideo">

		<iframe src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/" allow="autoplay" id="audio"></iframe>
</div>


		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
